import Splide from "https://cdn.jsdelivr.net/npm/@splidejs/splide@latest/dist/js/splide.esm.min.js";
export function splide_build() {
    new Splide("#image-carousel", {
        type: "loop",
        perPage: 1,
        focus: "center",
        autoplay: !0,
        interval: 3e3,
        pauseOnHover: !0,
        arrows: !1,
        pagination: !1
    }).mount()
}